Joining a collection to the same collection name. (MongoDB Query)<p>Is it possible to join a collection to itself with a different $match used?</p>
<p>I have below the same used case</p>
<p>Data:</p>
<pre><code>{ &quot;_id&quot; : 1, &quot;transactioncode&quot; : &quot;testtransactAA&quot;, &quot;staffcode&quot; : &quot;staffA1&quot;, &quot;isactive&quot; : true }
{ &quot;_id&quot; : 2, &quot;transactioncode&quot; : &quot;testtransactBB&quot;, &quot;staffcode&quot; : &quot;staffB1&quot;, &quot;isactive&quot; : true }
{ &quot;_id&quot; : 3, &quot;transactioncode&quot; : &quot;testtransactCC&quot;, &quot;staffcode&quot; : &quot;staffC1&quot;, &quot;isactive&quot; : false }
{ &quot;_id&quot; : 4, &quot;transactioncode&quot; : &quot;testtransactCC&quot;, &quot;staffcode&quot; : &quot;staffC2&quot;, &quot;isactive&quot; : false }
{ &quot;_id&quot; : 5, &quot;transactioncode&quot; : &quot;testtransactDD&quot;, &quot;staffcode&quot; : &quot;staffD1&quot;, &quot;isactive&quot; : true  }
{ &quot;_id&quot; : 6, &quot;transactioncode&quot; : &quot;testtransactEE&quot;, &quot;staffcode&quot; : &quot;staffE1&quot;, &quot;isactive&quot; : true  }
{ &quot;_id&quot; : 7, &quot;transactioncode&quot; : &quot;testtransactEE&quot;, &quot;staffcode&quot; : &quot;staffE2&quot;, &quot;isactive&quot; : false }
</code></pre>
<p>I want to display all unique transaction code and in the staff code there will be a condition that:</p>
<ul>
<li>If isactive is true, show the staffcode</li>
<li>If a transaction code consist of 1 or more staffcode, show only staffcode who has isactive: true</li>
<li>If a transaction code consist of 1 or more staffcode that have both isactive : false, make it null</li>
</ul>
<p>Output will be:</p>
<pre><code>{ &quot;transactioncode&quot; : &quot;testtransactAA&quot;, &quot;staffcode&quot; : &quot;staffA1&quot;}
{ &quot;transactioncode&quot; : &quot;testtransactBB&quot;, &quot;staffcode&quot; : &quot;staffB1&quot;}
{ &quot;transactioncode&quot; : &quot;testtransactCC&quot;, &quot;staffcode&quot; : null}
{ &quot;transactioncode&quot; : &quot;testtransactDD&quot;, &quot;staffcode&quot; : &quot;staffD1&quot;}
{ &quot;transactioncode&quot; : &quot;testtransactDD&quot;, &quot;staffcode&quot; : &quot;staffE1&quot;}
</code></pre>
<p>My code here is i am trying to rejoin the same table name but it is only getting documents that have isactive:true and ignoring those documents that have staffcode with both false status</p>
<pre><code>{
runCommand: {
    aggregate: &quot;operationsmonitoring&quot;,
    pipeline: [


{ $lookup: { from: 'operationsmonitoring', localField:'_id', foreignField: '_id', as: 'getIsactive' } },
     { $unwind: { path: '$getIsactive', preserveNullAndEmptyArrays: true } },
     {$match:{'getIsactive.isactive':true } },

                {
    $project:{
&quot;transactioncode&quot;:&quot;$transactioncode&quot;,
&quot;staffcode&quot;:&quot;$staffcode&quot;

            }
                }
],

&quot;cursor&quot;: {batchSize:100000}
</code></pre>
<p>}
}</p>
<p>Thank you in advance!</p>

