Spring Boot Mongo DB Lookup AggregationOperation<p>First of I want to say am new to MongoDB, especially MongoData with Springs. I have the following collections</p>
<p><strong>Category</strong></p>
<pre><code>@Data
@Document(collection = &quot;categories&quot;)
public class Category {
    @Id
    private ObjectId id;
    @CreatedBy
    private ObjectId creatorId;
    @CreatedDate
    private LocalDateTime createdAt;
    @LastModifiedDate
    private LocalDateTime modifiedAt;
    @LastModifiedBy
    private ObjectId modifiedBy;
    private String title;
    private String notes;
    private boolean enabled = true;
}
</code></pre>
<p>Activity</p>
<pre><code>@Data
@Document(collection = &quot;activities&quot;)
public class Activity {

    @Id
    private ObjectId id;
    @CreatedBy
    private ObjectId creatorId;
    @CreatedDate
    private LocalDateTime createdAt;
    @LastModifiedDate
    private LocalDateTime modifiedAt;
    @LastModifiedBy
    private ObjectId modifiedBy;

    private ObjectId budgetId;
    private ObjectId categoryId;
    private String title;
    private String notes;
    private Double estimatedBudget;
    private boolean enabled;
    private boolean recurring;
}

</code></pre>
<p>I have come up with a simple query that joins the two collections which works to my expectation as below (... might also not be super cool query). The idea is i want to get all the activities grouped inside Category based on categoryId. Then afterwards, i only want to retrieve activities having a given budgetId.
I should be able to retrieve all Categories irregardless of whether activities within it exists or not, Like LEFT JOIN in SQL</p>
<pre><code>db.categories.aggregate([
{

$lookup: {
        from: &quot;activities&quot;,
        localField : &quot;_id&quot;,
        foreignField: &quot;categoryId&quot;,
        pipeline: [
              {$match: { $and:[{&quot;budgetId&quot;: ObjectId(&quot;60f8ef1ed7056b730cdce1db&quot;) }] }}
        ],
        as: &quot;activities&quot;
    },
},
 {
        $match: {
            $and:[{&quot;enabled&quot;: true}]
            }
        }

])

</code></pre>
<p>This works somehow.
So the question is how to I translate the above query to AggregationOperation in springs?</p>
<p>I have the following, but it excludes the Categories that dont have Activities within it.</p>
<pre><code>  List&lt;AggregationOperation&gt; operations = new ArrayList&lt;&gt;();


        Criteria criteria = Criteria.where(&quot;enabled&quot;).is(true);

        operations.add(match(criteria));


        Criteria forBudgetActivitiesCriteria =  Criteria.where(&quot;activities.budgetId&quot;).is(budgetId);


        operations.add(lookup(&quot;activities&quot;, &quot;_id&quot;, &quot;categoryId&quot;, &quot;activities&quot;));
        operations.add(match(forBudgetActivitiesCriteria));

        TypedAggregation&lt;Category&gt; aggregation = newAggregation(Category.class, operations);
        AggregationResults&lt;Category&gt; results = mongoTemplate.aggregate(aggregation, Category.class);

</code></pre>
<p>Am guessing the problem is here</p>
<pre><code>Criteria.where(&quot;activities.budgetId&quot;).is(budgetId);
</code></pre>
<p>Help. And thanks in advance.</p>

